AppModule -->\n\nRFormModule->AppModule\n\n\n\n\n\nUserModule\n\nUserModule\n\nAppModule -->\n\nUserModule->AppModule\n\n\n\n\n\nCountdownService\n\nCountdownService\n\nAppModule -->\n\nCountdownService->AppModule\n\n\n\n\n\nStateParameterService\n\nStateParameterService\n\nAppModule -->\n\nStateParameterService->AppModule\n\n\n\n\n\n\n    \n    \n    \n        Zoom in\n        Reset\n        Zoom out\n    \n\n\n\n\n\n    \n        Info\n    \n    \n        Source\n    \n\n\n\n    \n\n        \n            File\n        \n        \n            src/app/app.module.ts\n        \n\n\n\n\n        \n            \n                \n                    Declarations\n                    \n                        \n                            AppComponent\n                        \n                        \n                            CountdownSnackbarComponent\n                        \n                        \n                            WelcomeComponent\n                        \n                    \n                \n                \n                    EntryComponents\n                    \n                        \n                            CountdownSnackbarComponent\n                        \n                    \n                \n                \n                    Providers\n                    \n                        \n                            CountdownService\n                        \n                        \n                            StateParameterService\n                        \n                    \n                \n                \n                    Imports\n                    \n                        \n                            FileUploadModule\n                        \n                        \n                            RFormModule\n                        \n                        \n                            UserModule\n                        \n                    \n                \n                \n                    Bootstrap\n                    \n                        \n                            AppComponent\n                        \n                    \n                \n            \n        \n\n\n    \n\n\n    \n        import { BrowserModule } from '@angular/platform-browser';\nimport { NgModule } from '@angular/core';\nimport { HttpClientModule } from '@angular/common/http';\nimport { RouterModule } from '@angular/router';\n\nimport { AppComponent,CountdownSnackbarComponent,CountdownService } from './app.component';\nimport { WelcomeComponent } from './home/welcome.component';\nimport { UserModule } from './users/user.module';\nimport { BrowserAnimationsModule } from '@angular/platform-browser/animations';\nimport { FileUploadModule } from './file-upload/file-upload.module';\nimport { RFormModule } from './r-form/r-form.module';\nimport { MatToolbarModule } from \"@angular/material/toolbar\";\nimport { StateParameterService } from \"./shared/st-parameter.service\";\nimport { ServiceWorkerModule } from '@angular/service-worker';\nimport { environment } from '../environments/environment';\nimport { MatSnackBarModule } from '@angular/material/snack-bar';\nimport { CookieService } from 'ngx-cookie-service';\n\n@NgModule({\n  declarations: [\n    AppComponent,\n    WelcomeComponent,\n    CountdownSnackbarComponent\n  ],\n  imports: [\n    BrowserModule,\n    HttpClientModule,\n    RouterModule.forRoot([\n      { path: 'home', component: WelcomeComponent },\n      { path: '', redirectTo: 'home', pathMatch: 'full' },\n      { path: '**', redirectTo: 'home', pathMatch: 'full' }\n    ]),\n    UserModule,\n    RFormModule,\n    FileUploadModule,\n    BrowserAnimationsModule,\n    MatToolbarModule,\n    MatSnackBarModule,\n    ServiceWorkerModule.register('ngsw-worker.js', { enabled: environment.production })\n  ],\n  entryComponents: [\n    CountdownSnackbarComponent,\n  ],\n  providers:[\n    CountdownService,\n    StateParameterService,CookieService\n  ],\n  exports:[\n    MatToolbarModule\n  ],\n  bootstrap: [AppComponent]\n})\nexport class AppModule { }\n\n    \n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"classes/AreaQuestion.html":{"url":"classes/AreaQuestion.html","title":"class - AreaQuestion","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n  Classes\n  AreaQuestion\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/app/r-form/question-loc.ts\n        \n\n\n            \n                Extends\n            \n            \n                        QuestionBase\n            \n\n\n\n            \n    Index\n    \n        \n                \n                    \n                        Properties\n                    \n                \n                \n                    \n                        \n                            \n                                controlType\n                            \n                            \n                                controlType\n                            \n                            \n                                key\n                            \n                            \n                                label\n                            \n                            \n                                options\n                            \n                            \n                                order\n                            \n                            \n                                required\n                            \n                            \n                                type\n                            \n                            \n                                value\n                            \n                        \n                    \n                \n\n\n\n\n\n\n        \n    \n\n\n\n   