 -->\n\nFileUploadComponent->FileUploadModule\n\n\n\n\n\n\n    \n    \n    \n        Zoom in\n        Reset\n        Zoom out\n    \n\n\n\n\n\n    \n        Info\n    \n    \n        Source\n    \n\n\n\n    \n\n        \n            File\n        \n        \n            src/app/file-upload/file-upload.module.ts\n        \n\n\n\n\n        \n            \n                \n                    Declarations\n                    \n                        \n                            FileUploadComponent\n                        \n                    \n                \n            \n        \n\n\n    \n\n\n    \n        import { NgModule } from '@angular/core';\nimport { BrowserModule } from '@angular/platform-browser';\nimport { ReactiveFormsModule } from '@angular/forms';\nimport { FileUploadComponent } from './file-upload.component';\nimport { RouterModule } from '@angular/router';\nimport { MatFormFieldModule } from '@angular/material/form-field';\nimport { MatInputModule } from '@angular/material/input';\nimport { MatButtonModule } from '@angular/material/button';\nimport { MatToolbarModule } from '@angular/material/toolbar';\nimport { MatIconModule } from \"@angular/material/icon\";\nimport { MatCardModule } from \"@angular/material/card\";\nimport { MatProgressBarModule } from \"@angular/material/progress-bar\";\nimport { MaterialFileInputModule } from 'ngx-material-file-input';\nimport { FormGuard } from \"./form.guard\";\n@NgModule({\n  declarations: [\n    FileUploadComponent,\n  ],\n  imports: [\n    BrowserModule,\n    MatFormFieldModule,\n    MatInputModule,\n    MatButtonModule,\n    MatToolbarModule,\n    MatIconModule,\n    MatCardModule,\n    MatProgressBarModule,\n    ReactiveFormsModule,\n    MaterialFileInputModule,\n    RouterModule.forChild([\n      { path: 'form/pic', canActivate: [FormGuard], component: FileUploadComponent },\n      { path: 'form/bio', canActivate: [FormGuard], component: FileUploadComponent }\n    ]),\n  ],\n  exports:[\n    MatFormFieldModule,\n    MatInputModule,\n    MatButtonModule\n  ]\n})\nexport class FileUploadModule { }\n\n    \n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"injectables/FileUploadService.html":{"url":"injectables/FileUploadService.html","title":"injectable - FileUploadService","body":"\n                   \n\n\n\n\n\n\n\n\n  Injectables\n  FileUploadService\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/app/file-upload/upload.service.ts\n        \n\n            \n                Description\n            \n            \n                FileUploadService Injectable \n\n            \n\n\n\n            \n    Index\n    \n        \n\n                \n                    \n                        Methods\n                    \n                \n                \n                    \n                        \n                            \n                                postImg\n                            \n                        \n                    \n                \n\n\n\n\n\n        \n    \n\n\n            \n    Constructor\n        \n            \n                \n                    \nconstructor(http: HttpClient)\n                    \n                \n                        \n                            \n                                Defined in src/app/file-upload/upload.service.ts:9\n                            \n                        \n\n                \n                    \n                            Constructs the Injectable\n\n                            \n                                    Parameters :\n                                    \n                                        \n                                            \n                                                Name\n                                                    Type\n                                                Optional\n                                                    Description\n                                            \n                                        \n                                        \n                                                \n                                                        http\n                                                  \n                                                        \n                                                                        HttpClient\n                                                        \n                                                  \n                                                    \n                                                            No\n                                                    \n                                                    \n                                                        \n                                                                HTTP Client\n\n                                                        \n                                                \n                                        \n                                    \n                            \n                    \n                \n            \n        \n\n\n            \n    \n    \n        Methods\n    \n    \n        \n            \n                \n                    \n                    \n                        \n                            postImg\n                        \n                        \n                    \n                \n            \n            \n                \npostImg(file: File, id: string, hostname: string, type: string)\n                \n            \n\n\n            \n                \n                    Defined in src/app/file-upload/upload.service.ts:22\n                \n            \n\n\n            \n                \n                    Build the post request of the image to the server\n\n\n                    \n                        Parameters :\n                        \n                            \n                                \n                                    Name\n                                    Type\n                                    Optional\n                                    Description\n                                \n                            \n                            \n                                \n                                    file\n                                    \n                                            File\n                                    \n\n                                    \n                                        No\n                                    \n\n\n                                    \n                                        File Object to upload\n\n                                    \n                                \n                                \n                                    id\n                                    \n                                                string\n                                    \n\n                                    \n                                        No\n                                    \n\n\n                                    \n                                        Citizen ID to append to the formdata of the request\n\n                                    \n                                \n                                \n                                    hostname\n                                    \n                                                string\n                                    \n\n                                    \n                                        No\n                                    \n\n\n                                    \n                                        URL of the server (remote or local)\n\n                                    \n                                \n                                \n                                    type\n                                    \n                                                string\n                                    \n\n                                    \n                                        No\n                                    \n\n\n                                    \n                                        Refers to the type of the image (Portrait or fingerprint)\n\n                                    \n                                \n                            \n                        \n                    \n                    \n                    \n                    \n                        Returns :     Observable>\n\n                    \n                    \n                        \n                    \n                \n            \n        \n    \n\n\n    \n\n\n    \n        import { Injectable } from '@angular/core';\nimport { HttpClient, HttpRequest, HttpEvent,HttpHeaders } from  '@angular/common/http';\nimport { Observable, } from 'rxjs';\n\n/** FileUploadService Injectable */\n@Injectable({\n  providedIn: 'root'\n})\nexport class FileUploadService {\n  /**\n   * Constructs the Injectable\n   * @param http HTTP Client\n   */\n  constructor(private http: HttpClient) { }\n  /**\n   * Build the post request of the image to the server\n   * @param file File Object to upload\n   * @param id Citizen ID to append to the formdata of the request\n   * @param hostname URL of the server (remote or local)\n   * @param type Refers to the type of the image (Portrait or fingerprint)\n   */\n  postImg(file: File,id:string,hostname:string,type:string): Observable> {\n    const formData = new FormData();\n    formData.append('_id',id);\n    formData.append('file', file,file.name);\n\n    const req = new HttpRequest('POST', hostname+'/api/upload/'+type, formData, {\n      reportProgress: true,\n      responseType: 'json'\n    });\n    return this.http.request(req);\n  }\n\n}\n\n    \n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"guards/FormGuard.html":{"url":"guards/FormGuard.html","title":"guard - FormGuard","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n    Guards\n    FormGuard\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n        \n            \n            File\n            \n            \n                src/app/file-upload/form.guard.ts\n            \n\n                \n                Description\n                \n                \n                    we use this Form Guard to prohibit access to the next steps of the form if we don't have retrieved the citizen id \n\n                \n\n\n\n\n                \n    Index\n    \n        \n\n                \n                    \n                        Methods\n                    \n                \n                \n                    \n                        \n                            \n                                canActivate\n                            \n                        \n                    \n                \n\n\n\n\n\n        \n    \n\n\n                \n    Constructor\n        \n            \n                \n                    \nconstructor(router: Router, stService: StateParameterService)\n                    \n                \n                        \n                            \n                                Defined in src/app/file-upload/form.guard.ts:10\n                            \n                        \n\n                \n                    \n                            Construct the FormGuard Injectable\n\n                            \n                                    Parameters :\n                                    \n                                        \n                                          